import React, { Component } from 'react';
import Search from '../components/search';
import FixedBladesList from '../components/fixedBladesList';
import AddKnifeForm from './addKnifeForm';

const CurrentDate = (props) => {
    return (
        <div>
            <p>The current date is: {props.date}</p>
        </div>
    );
};

class Table extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            input: '',
            brand: '',
            visibility: false,
            inputModel: '',
            model: '',
            pricePaid: 0,
            wouldSalePrice: 0,
            listForSale: false,
            brandArray: '',
            modelArray: '',
        };
        // this.toggleVisibility = this.toggleVisibility.bind(this);
        // this.handleChange = this.handleChange.bind(this);
        // this.handleChange1 = this.handleChange1.bind(this);
        // this.handleSubmit = this.handleSubmit.bind(this);
    }
    render() {
        return (
            <table className='dashboardTableStyling'>
                <tr className='dashboardTableHeadStyling'><h3>Select Category</h3></tr>
                <p>
                    <FixedBladesList fixedList={'SpyderCo, BenchMade'} />
                </p>
                <tr>Automatic</tr>
                <tr>Flippers</tr>
                <tr>Slip Joints</tr>
                <tr>Assisted</tr>
            </table>
        )
    }
}

const User = (props) => {
    return (
        <div>
            <p>Welcome {props.name}</p>
        </div>
    );
};

class YourKnifePage extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            input: '',
            brand: '',
            visibility: false,
            inputModel: '',
            model: '',
            pricePaid: 0,
            wouldSalePrice: 0,
            listForSale: false,
            brandArray: '',
            modelArray: '',
        };
        // this.toggleVisibility = this.toggleVisibility.bind(this);
        // this.handleChange = this.handleChange.bind(this);
        // this.handleChange1 = this.handleChange1.bind(this);
        // this.handleSubmit = this.handleSubmit.bind(this);
    }
    render(
    ) {

        return (
            <div className='dashboard'>
                <h1 className='loginPageTitle'>BladeX</h1>
                <h3 className='dashboardTitle'>Your Knives</h3>
                <CurrentDate date={Date()} />
                <User user={this.props.name} />
                <Search />
                <AddKnifeForm />
                <Table brand={this.state.brand} />
            </div>
        );
    }
}

export default YourKnifePage;
